def ok(n):
    s = str(n)
    if s[0] != s[-1]: return False
    r = s.rfind(max(s))
    first, last = list(s[:r]), list(s[r:])
    return first == sorted(first) and last == sorted(last, reverse=True)
print([k for k in range(1, 1222) if ok(k)]) # _Michael S. Branicky_, Feb 02 2026

